import React from "react";

const List = ({ people }) => {
  return (
    <div>
      {people.map((p) => {
        return (
          <article key={p.id} className="person">
            <img src={p.image} alt={p.name} />
            <div>
              <h4>{p.name}</h4>
            </div>
          </article>
        );
      })}
    </div>
  );
};

export default List;
